School is back in session, and alt-porn director Joanna Angel is celebrating student unions everywhere with I Fucked My Teacher, the all-new Burning Angel Entertainment DVD that delivers a higher education in postmodern sex. This exciting release features break-out performances from such popular Burning Angel regulars as Asphyxia, Krysta Kaos, Sparky Sin Claire, Vyxen Steel and Ramon Nomar. This exciting look at high education is coming your way from Burning Angel Entertainment and distributed exclusively on DVD by Vouyer Media.
